import React, { Component } from 'react';
import './App.css';
import { CardList } from './components/card-list/card-list.component';

class App extends Component {
  constructor(){
    super();

    this.state = {
      houses: []
    };
  }



  render() {
    return (
      <div className="App">
      <CardList houses={this.state.houses}/> 
      </div>
    )
  }
}

export default App;
